import './App.css';
import React, { useState } from 'react';
import {Container, Header, Footer, Progress, Button } from 'rsuite'

function App() {

  const [text, setText] = useState('')

  const handleSubmit= (e) => {
    fetch('http://localhost:3001', {
    method: 'POST',
    headers: {"Content-Type": "application/json"},
    body: JSON.stringify(text)
    }).then(() => {
      console.log('Added')
    })
  }

  const { Line } = Progress

  return (
    <Container className="mainContainer" align="center">
      <Header>
        <h2>Siema</h2>
      </Header>
        <input type="file"/>
        <Button>
          Upload!
        </Button>
        <Progress.Line />
        <Line percent={50} status="fail" />
        <Progress.Line percent={50} strokeColor='#ffc107' status='success'/>
        <Footer>AUUUUU</Footer>
    </Container>
  );
}

export default App;
